  const getTriviaQuestions = async () => {
    const questions = await getTriviaApiQuestions(
      5,
      "Entertainment: Books",
      "hard"
    );
    setQuestions(questions);
  };

  const getQuestions = async () => {
    const questions = await getTriviaApiQuestions(
      5,
      "Entertainment: Books",
      "hard"
    );
    setQuestions(questions);
  };

  console.log("QST", questions);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <button onClick={getTriviaQuestions}>GET TRIVIA QUESTIONS</button>
        <button onClick={getProgrammingQuestions}>
          GET PROGRAMMING QUESTIONS
        </button>
      </header>
    </div>
  );
};

export default App;
